import React from "react";

function UploadWidget() {
  return (
    <div>
      <form action="/" method="post">
        <input type="file" name="file-to-upload">
          <input type="submit" value="upload"></input>
        </input>
      </form>
    </div>
  );
}

export default UploadWidget;
